import{_ as a,c as s,o as t,ag as o}from"./chunks/framework.Ds6Eueu6.js";const u=JSON.parse('{"title":"VALUES","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/VALUES.md","filePath":"docs/7x/ref_guide/sql_commands/VALUES.md"}'),n={name:"docs/7x/ref_guide/sql_commands/VALUES.md"};function i(c,e,l,d,p,r){return t(),s("div",null,e[0]||(e[0]=[o(`<h1 id="values" tabindex="-1">VALUES <a class="header-anchor" href="#values" aria-label="Permalink to &quot;VALUES&quot;">​</a></h1><p>Computes a set of rows.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>VALUES ( &lt;expression&gt; [, ...] ) [, ...]</span></span>
<span class="line"><span>   [ORDER BY &lt;sort_expression&gt; [ ASC | DESC | USING &lt;operator&gt; ] [, ...] ]</span></span>
<span class="line"><span>   [LIMIT { &lt;count&gt; | ALL } ] </span></span>
<span class="line"><span>   [OFFSET &lt;start&gt; [ ROW | ROWS ] ]</span></span>
<span class="line"><span>   [FETCH { FIRST | NEXT } [&lt;count&gt; ] { ROW | ROWS } ONLY ]</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>VALUES</code> computes a row value or set of row values specified by value expressions. It is most commonly used to generate a &quot;constant table&quot; within a larger command, but it can be used on its own.</p><p>When more than one row is specified, all the rows must have the same number of elements. The data types of the resulting table&#39;s columns are determined by combining the explicit or inferred types of the expressions appearing in that column, using the same rules as for <code>UNION</code>.</p><p>Within larger commands, <code>VALUES</code> is syntactically allowed anywhere that <code>SELECT</code> is. Because it is treated like a <code>SELECT</code> by the grammar, it is possible to use the <code>ORDER BY</code>, <code>LIMIT</code> (or equivalent <code>FETCH FIRST</code>), and <code>OFFSET</code> clauses with a <code>VALUES</code> command.</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>expression : A constant or expression to compute and insert at the indicated place in the resulting table (set of rows). In a <code>VALUES</code> list appearing at the top level of an <code>INSERT</code>, an expression can be replaced by <code>DEFAULT</code> to indicate that the destination column&#39;s default value should be inserted. <code>DEFAULT</code> cannot be used when <code>VALUES</code> appears in other contexts.</p><p>sort_expression : An expression or integer constant indicating how to sort the result rows. This expression may refer to the columns of the <code>VALUES</code> result as <code>column1</code>, <code>column2</code>, etc. For more details, see &quot;The ORDER BY Clause&quot; in the parameters for <a href="./SELECT.html">SELECT</a>.</p><p>operator : A sorting operator. For more details, see &quot;The ORDER BY Clause&quot; in the parameters for <a href="./SELECT.html">SELECT</a>.</p><p>LIMIT count OFFSET start : The maximum number of rows to return. For more details, see &quot;The LIMIT Clause&quot; in the parameters for <a href="./SELECT.html">SELECT</a>.</p><h2 id="notes" tabindex="-1"><a id="section5"></a>Notes <a class="header-anchor" href="#notes" aria-label="Permalink to &quot;&lt;a id=&quot;section5&quot;&gt;&lt;/a&gt;Notes&quot;">​</a></h2><p><code>VALUES</code> lists with very large numbers of rows should be avoided, as you may encounter out-of-memory failures or poor performance. <code>VALUES</code> appearing within <code>INSERT</code> is a special case (because the desired column types are known from the <code>INSERT</code>&#39;s target table, and need not be inferred by scanning the <code>VALUES</code> list), so it can handle larger lists than are practical in other contexts.</p><h2 id="examples" tabindex="-1"><a id="section6"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>A bare <code>VALUES</code> command:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>VALUES (1, &#39;one&#39;), (2, &#39;two&#39;), (3, &#39;three&#39;);</span></span></code></pre></div><p>This will return a table of two columns and three rows. It is effectively equivalent to:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>SELECT 1 AS column1, &#39;one&#39; AS column2</span></span>
<span class="line"><span>UNION ALL</span></span>
<span class="line"><span>SELECT 2, &#39;two&#39;</span></span>
<span class="line"><span>UNION ALL</span></span>
<span class="line"><span>SELECT 3, &#39;three&#39;;</span></span></code></pre></div><p>More usually, <code>VALUES</code> is used within a larger SQL command. The most common use is in <code>INSERT</code>:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>INSERT INTO films (code, title, did, date_prod, kind)</span></span>
<span class="line"><span>    VALUES (&#39;T_601&#39;, &#39;Yojimbo&#39;, 106, &#39;1961-06-16&#39;, &#39;Drama&#39;);</span></span></code></pre></div><p>In the context of <code>INSERT</code>, entries of a <code>VALUES</code> list can be <code>DEFAULT</code> to indicate that the column default should be used here instead of specifying a value:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>INSERT INTO films VALUES</span></span>
<span class="line"><span>    (&#39;UA502&#39;, &#39;Bananas&#39;, 105, DEFAULT, &#39;Comedy&#39;, &#39;82 </span></span>
<span class="line"><span>minutes&#39;),</span></span>
<span class="line"><span>    (&#39;T_601&#39;, &#39;Yojimbo&#39;, 106, DEFAULT, &#39;Drama&#39;, DEFAULT);</span></span></code></pre></div><p><code>VALUES</code> can also be used where a sub-<code>SELECT</code> might be written, for example in a <code>FROM</code> clause:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>SELECT f.* FROM films f, (VALUES(&#39;MGM&#39;, &#39;Horror&#39;), (&#39;UA&#39;, </span></span>
<span class="line"><span>&#39;Sci-Fi&#39;)) AS t (studio, kind) WHERE f.studio = t.studio AND </span></span>
<span class="line"><span>f.kind = t.kind;</span></span>
<span class="line"><span>UPDATE employees SET salary = salary * v.increase FROM </span></span>
<span class="line"><span>(VALUES(1, 200000, 1.2), (2, 400000, 1.4)) AS v (depno, </span></span>
<span class="line"><span>target, increase) WHERE employees.depno = v.depno AND </span></span>
<span class="line"><span>employees.sales &gt;= v.target;</span></span></code></pre></div><p>Note that an <code>AS</code> clause is required when <code>VALUES</code> is used in a <code>FROM</code> clause, just as is true for <code>SELECT</code>. It is not required that the <code>AS</code> clause specify names for all the columns, but it is good practice to do so. The default column names for <code>VALUES</code> are <code>column1</code>, <code>column2</code>, etc. in WarehousePG, but these names might be different in other database systems.</p><p>When <code>VALUES</code> is used in <code>INSERT</code>, the values are all automatically coerced to the data type of the corresponding destination column. When it is used in other contexts, it may be necessary to specify the correct data type. If the entries are all quoted literal constants, coercing the first is sufficient to determine the assumed type for all:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>SELECT * FROM machines WHERE ip_address IN </span></span>
<span class="line"><span>(VALUES(&#39;192.168.0.1&#39;::inet), (&#39;192.168.0.10&#39;), </span></span>
<span class="line"><span>(&#39;192.0.2.43&#39;));</span></span></code></pre></div><blockquote><p><strong>Note</strong> For simple <code>IN</code> tests, it is better to rely on the list-of-scalars form of <code>IN</code> than to write a <code>VALUES</code> query as shown above. The list of scalars method requires less writing and is often more efficient.</p></blockquote><h2 id="compatibility" tabindex="-1"><a id="section7"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p><code>VALUES</code> conforms to the SQL standard. <code>LIMIT</code> and <code>OFFSET</code> are WarehousePG extensions; see also under <a href="./SELECT.html">SELECT</a>.</p><h2 id="see-also" tabindex="-1"><a id="section8"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section8&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./INSERT.html">INSERT</a>, <a href="./SELECT.html">SELECT</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>`,35)]))}const m=a(n,[["render",i]]);export{u as __pageData,m as default};
